import { StyleCardTask } from "./styles";
import { AiOutlineCheckCircle, AiOutlineCloseCircle } from "react-icons/ai";

const CardTask = ({ item }) => {
  return (
    <div>
      <StyleCardTask>
      <div></div>
        <span>Título: {item.title}</span>
        <span>Categoria: {item.category}</span>
        <span>Dificuldade: {item.difficulty}</span>
        <span>Frequência: {item.frequency}</span>
        <AiOutlineCheckCircle style={{ fontSize: "30px", color: "green" }} />
        <AiOutlineCloseCircle style={{ fontSize: "30px", color: "red" }} />
      </StyleCardTask>
    </div>
  );
};

export default CardTask;
